import{_ as e,o as t,c as a,a7 as i}from"./chunks/framework.CmR4KQfH.js";const o="/images/2007/03/01_12769.jpg",f=JSON.parse('{"title":"多普达575刷机摘要","description":"","frontmatter":{"title":"多普达575刷机摘要","tags":["刷机","多普达"],"id":919,"categories":["Digital"],"abbrlink":"35b47397","date":"2007-03-01T14:00:49.000Z"},"headers":[],"relativePath":"Digital/多普达575刷机摘要.md","filePath":"Digital/多普达575刷机摘要.md","lastUpdated":1764233043000}'),_={name:"Digital/多普达575刷机摘要.md"},c=i('<h1 id="多普达575刷机摘要" tabindex="-1">多普达575刷机摘要 <a class="header-anchor" href="#多普达575刷机摘要" aria-label="Permalink to &quot;多普达575刷机摘要&quot;">​</a></h1><p><img src="'+o+'" alt="Windows Mobile 2003"></p><p>回深圳前一天跟老爸换了手机，是多普达575，移动的定制机，开机关机都是移动Logo和声音，到处还有移动的菜单，就像电脑被流氓插件强奸一样，况且我用联通啊。</p><p>昨天下班后刷了系统，现在使用较多的是WM3 174和184，WM5好像软件不是很多，174跟184的区别在于，174是用多普达575行货ROM改的，184是用585的ROM改的，我刷的是174版本</p><p>刷机摘要：</p><ol><li>安装Microsoft ActiveSync同步软件，确保手机能顺利连上电脑</li><li>用SDA Security Unlocker进行解锁，其实是通过修改注册表提高权限</li><li>用SPV-Services 把CID改成SuperCID了，这样就算刷坏了，也可以救活</li><li>用TyphoonNBFTools改SPL，刷为064或091，WM5必须用091。查看SPL版本可以进入三色屏，方法是先关机，然后按住右侧照相按钮不放，再按开机键半秒，等进入三色屏即可放开，另一方法是按住照相键的时候插入USB线</li><li>确保手机有一半以上的电量</li><li>最后用Patched_RUU进行刷机。把Patched_RUU工具解压到一个独立目录，然后把nbf格式的ROM放进去，注意Patched_RUU会自动寻找nbf文件，所以目录里只能有一个nbf文件。 运行Patched_RUU前把ActiveSync关掉，在任务管理器关掉wcescomm.exe即可。 关掉手机进入三色屏，接上数据线，运行Patched_RUU，照着提示点就可以了，刷机的时候手机屏幕会有进度条显示，刷完了手机会自己重启</li></ol>',6),l=[c];function s(r,n,d,p,h,m){return t(),a("div",{"data-pagefind-body":!0},l)}const P=e(_,[["render",s]]);export{f as __pageData,P as default};
